    true,nt"url": null,nt"notes": "On a monthly basis, the Office of Personnel
    Management (OPM) provides Civil Service benefit and payment data to SSA that is
    used in determining eligibility for Supplemental Security Income (SSI) payments
    and Special Veterans' Benefits (SVB). SSA will match OPM's data with SSA's records
    to verify the accuracy of information furnished by applicants and recipients concerning
    eligibility factors for the SSI program and for the Special Veterans' Benefits (SVB)
    program. The SVB program provides benefits to certain World War II veterans.",nt"license_title":
